{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"mount_file_id":"1m-SHB8z3hhrDsOgnEgrBI3SbGwEITLOy","authorship_tag":"ABX9TyNnpFCbZoyK+L74ezyd+kvz"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":null,"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":447},"id":"tBXW18Sq40H0","executionInfo":{"status":"ok","timestamp":1734466836377,"user_tz":-120,"elapsed":2951,"user":{"displayName":"Ярослав Білотіл","userId":"06797585363548962278"}},"outputId":"dfb7920c-122c-4185-fb90-f0dd9cd1513b"},"outputs":[{"output_type":"stream","name":"stdout","text":["Accuracy of Naive Bayes classifier = 99.75 %\n"]},{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}],"source":["import numpy as np\n","import matplotlib.pyplot as plt\n","from sklearn.naive_bayes import GaussianNB\n","from sklearn.model_selection import train_test_split\n","from utilities import visualize_classifier\n","# Вхідний файл, який містить дані\n","input_file = 'data_multivar_nb.txt'\n","# Завантаження даних із вхідного файлу\n","data = np.loadtxt(input_file, delimiter=',')\n","X, y = data[:, :-1], data[:, -1]\n","# Створення наївного байєсовського класифікатора\n","classifier = GaussianNB()\n","# Тренування класифікатора\n","classifier.fit(X, y)\n","# Прогнозування значень для тренувальних даних\n","y_pred = classifier.predict(X)\n","# Обчислення якості класифікатора\n","accuracy = 100.0 * (y == y_pred).sum() / X.shape[0]\n","print(\"Accuracy of Naive Bayes classifier =\", round(accuracy, 2), \"%\")\n","# Візуалізація результатів роботи класифікатора\n","visualize_classifier(classifier, X, y)"]},{"cell_type":"code","source":["import numpy as np\n","from sklearn.model_selection import train_test_split, cross_val_score\n","from sklearn.naive_bayes import GaussianNB\n","from sklearn.metrics import accuracy_score\n","import matplotlib.pyplot as plt\n","from utilities import visualize_classifier\n","# Розбивка даних на навчальний та тестовий набори\n","X = np.random.rand(100, 2) * 10  # Приклад набору даних\n","y = np.random.randint(0, 4, size=100)  # Приклад міток\n","\n","X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.2, random_state=3)\n","\n","# Тренування нового класифікатора\n","classifier_new = GaussianNB()\n","classifier_new.fit(X_train, y_train)\n","y_test_pred = classifier_new.predict(X_test)\n","\n","# Обчислення точності\n","accuracy = accuracy_score(y_test, y_test_pred) * 100\n","print(\"Accuracy of the new classifier =\", round(accuracy, 2), \"%\")\n","\n","# Візуалізація роботи класифікатора\n","visualize_classifier(classifier_new, X_test, y_test)\n","\n","# Перехресна перевірка\n","num_folds = 3\n","accuracy_values = cross_val_score(classifier_new, X, y, scoring='accuracy', cv=num_folds)\n","print(\"Accuracy: \" + str(round(100 * accuracy_values.mean(), 2)) + \"%\")\n","\n","precision_values = cross_val_score(classifier_new, X, y, scoring='precision_weighted', cv=num_folds)\n","print(\"Precision: \" + str(round(100 * precision_values.mean(), 2)) + \"%\")\n","\n","recall_values = cross_val_score(classifier_new, X, y, scoring='recall_weighted', cv=num_folds)\n","print(\"Recall: \" + str(round(100 * recall_values.mean(), 2)) + \"%\")\n","\n","f1_values = cross_val_score(classifier_new, X, y, scoring='f1_weighted', cv=num_folds)\n","print(\"F1: \" + str(round(100 * f1_values.mean(), 2)) + \"%\")\n"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":517},"id":"IqwHWvxK49db","executionInfo":{"status":"ok","timestamp":1734466855696,"user_tz":-120,"elapsed":1621,"user":{"displayName":"Ярослав Білотіл","userId":"06797585363548962278"}},"outputId":"031df830-15b0-468e-b4c1-835ca7ea84ee"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["Accuracy of the new classifier = 35.0 %\n"]},{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}},{"output_type":"stream","name":"stdout","text":["Accuracy: 24.0%\n","Precision: 23.57%\n","Recall: 24.0%\n","F1: 23.18%\n"]}]}]}